Here's a simple example of a TikTok bot scrapper written in Go:

**Note:** This code is for educational purposes only.

```go
package main

import (
	"fmt"
	"log"
	"net/http"
	"regexp"
	"strings"
)

type TikTokBot struct {
	client *http.Client
}

func NewTikTokBot() *TikTokBot {
	client := &http.Client{}
	return &TikTokBot{client: client}
}

func (bot *TikTokBot) ScrapeUserVideos(username string) ([]string, error) {
	url := fmt.Sprintf("https://www.tiktok.com/@%s", username)
	req, err := http.NewRequest("GET", url, nil)
	if err!= nil {
		return nil, err
	}

	resp, err := bot.client.Do(req)
	if err!= nil {
		return nil, err
	}
	defer resp.Body.Close()

	if resp.StatusCode!= http.StatusOK {
		return nil, fmt.Errorf("status code: %d", resp.StatusCode)
	}

	body, err := ioutil.ReadAll(resp.Body)
	if err!= nil {
		return nil, err
	}

	re := regexp.MustCompile(`"item":\s*{.*?"video_id":"(.*?)","`)
	videos := re.FindAllStringSubmatch(string(body), -1)

	var videoIds []string
	for _, video := range videos {
		videoIds = append(videoIds, video[1])
	}

	return videoIds, nil
}

func main() {
	bot := NewTikTokBot()
	videos, err := bot.ScrapeUserVideos("charlidamelio")
	if err!= nil {
		log.Fatal(err)
	}
	fmt.Println(videos)
}
```

This code sends a GET request to the TikTok user's profile page and extracts the video IDs using regular expressions.

Here's an explanation of the code:

*   We create a `TikTokBot` struct that has an `http.Client` field.
*   The `ScrapeUserVideos` method sends a GET request to the TikTok user's profile page.
*   We read the response body and use regular expressions to extract the video IDs.
*   We return the list of video IDs.

**Example Use Cases:**

*   Scrape videos of a specific user:

    ```go
bot := NewTikTokBot()
videos, err := bot.ScrapeUserVideos("charlidamelio")
```
*   Scrape videos of multiple users:

    ```go
usernames := []string{"charlidamelio", "addisonre", "zachking"}
for _, username := range usernames {
	videos, err := bot.ScrapeUserVideos(username)
	if err!= nil {
		log.Println(err)
		continue
	}
	log.Println(videos)
}
```
**Note:** TikTok has a rate limit on the number of requests you can send per hour. Be sure to check their documentation to avoid getting banned.

