#include <RubberBandStretcher.h>
#include <sndfile.hh>

class Autotune {
public:
  Autotune(float sampleRate, int numChannels) 
    : sampleRate_(sampleRate), numChannels_(numChannels) {
    stretcher_ = new RubberBandStretcher(sampleRate, numChannels);
  }

  ~Autotune() {
    delete stretcher_;
  }

  void setTuning(float tuning) {
    stretcher_->setTuning(tuning);
  }

  void process(float* input, int numSamples) {
    stretcher_->process(input, numSamples);
  }

  void getOutput(float* output) {
    stretcher_->getOutput(output);
  }

private:
  RubberBandStretcher* stretcher_;
  float sampleRate_;
  int numChannels_;
};

int main() {
  // Initialize the autotune class
  Autotune autotune(44100, 2);

  // Set the tuning to 0.5 (half-step)
  autotune.setTuning(0.5);

  // Read an audio file
  SndfileHandle file = sndfile_open("input.wav");

  // Process the audio
  while (file.readf_float(0, &autotune.process) > 0) {
    // Do nothing
  }

  // Write the output to a new file
  SndfileHandle outputFile = sndfile_open("output.wav");
  autotune.getOutput(outputFile);

  return 0;
}
```
