The `process` method takes an array of `float` values representing the input audio signal, and modifies it in place to apply the autotune effect.

The `getOutput` method returns the processed audio signal.

In the `main` function, we create an instance of the `Autotune` class, set the tuning to 0.5 (half-step), read an audio file, process it using the `Autotune` class, and write the output to a new file.

