You can round a double to two decimal places in C using the `round()` function from the `math.h` library, along with the `pow()` function to specify the number of decimal places to round to.

Here is an example:

```c
#include <stdio.h>
#include <math.h>

int main() {
    double number = 10.56789;
    double roundedNumber = round(number * 100.0) / 100.0;

    printf("Rounded number: %.2f\n", roundedNumber);

    return 0;
}
```

In this code:

*   `round(number * 100.0)` rounds `number` to the nearest integer.
*   `/ 100.0` then divides the result by 100 to restore the original scale.

However, be aware that `round()` can be affected by the system's floating point precision.

Alternatively, you can use `printf()` to print the number with two decimal places without actually changing its value:

```c
#include <stdio.h>

int main() {
    double number = 10.56789;

    printf("Rounded number: %.2f\n", number);

    return 0;
}
```

In this case, `%.2f` is a format specifier that tells `printf()` to print `number` with two decimal places.

