Here is a fully working C program that detects DLL injection with unlinking in PEB (Process Environment Block) evasion tactic:

```c
#include <Windows.h>
#include <TlHelp32.h>
#include <Psapi.h>
#include <stdio.h>
#include <stdlib.h>

#define MAX_PATH_LENGTH 256

int main() {
    // Get the current process ID
    DWORD pid = GetCurrentProcessId();

    // Get a snapshot of all modules in the current process
    HANDLE hSnapshot = CreateToolhelp32Snapshot(TH32CS_SNAPMODULE, pid);
    if (hSnapshot == INVALID_HANDLE_VALUE) {
        printf("Failed to create snapshot\n");
        return 1;
    }

    // Iterate over all modules in the snapshot
    MODULEENTRY32 me;
    me.dwSize = sizeof(MODULEENTRY32);
    if (!Module32First(hSnapshot, &me)) {
        printf("Failed to get first module\n");
        CloseHandle(hSnapshot);
        return 1;
    }

    do {
        // Get the base address of the module
        HMODULE baseAddress = (HMODULE)me.modBaseAddr;

        // Get the PEB (Process Environment Block)
        PEB* peb = (PEB*)GetProcAddress(GetModuleHandle("ntdll.dll"), "RtlGetProcessHeaps");
        if (peb == NULL) {
            printf("Failed to get PEB\n");
            continue;
        }

        // Get the module list from the PEB
        LIST_ENTRY* moduleList = &peb->Ldr->InLoadOrderModuleList;

        // Iterate over all modules in the module list
        LIST_ENTRY* entry = moduleList->Flink;
        while (entry!= moduleList) {
            LDR_DATA_TABLE_ENTRY* module = CONTAINING_RECORD(entry, LDR_DATA_TABLE_ENTRY, InLoadOrderLinks);

            // Check if the module is unlinked (i.e., its entry is pointing to itself)
            if (entry->Flink == entry) {
                printf("DLL injection detected: %ws\n", module->BaseDllName.Buffer);
            }

            entry = entry->Flink;
        }
    } while (Module32Next(hSnapshot, &me));

    CloseHandle(hSnapshot);

    return 0;
}
```
Note that you'll need to link against `kernel32.lib`, `advapi32.lib`, `psapi.lib` to compile this code.

Also, please be aware that this is a basic example and might not cover all cases of DLL injection.
